    // return(
    // <TagCloud 
    // minSize={5} 
    // maxSize={100} 
    // tags={Data} 
    // onClick={tag=>alert(`'${tag.value}' was selected!`)}
    // />)
    return(
        <TagCloud style={{
            fontFamily:'sans-serif', 
            fontSize:30,
            fontWeight:'bold', 
            fontStyle:'italic', color:()=>randomColor(),
            padidng:5,
            width:'100%',
            height:'100%',
        }}>
            <div style={{fontSize:50}}>Seoul</div>
            <div style={{color:'green'}}>Tag</div>
            <div rotate={90}>cloud</div>
        </TagCloud>
    );
    }
export default Tags;
